mapper.select:

select 

from FCMSGIN
where FCMSGIN_TXDATE = #{fcmsginTxdate,jdbcType=CHAR}
  and FCMSGIN_BRNO = #{fcmsginBrno,jdbcType=CHAR}
  and FCMSGIN_FEPNO = #{fcmsginFepno,jdbcType=CHAR}

mapper.delete:

delete from FCMSGIN
where FCMSGIN_TXDATE = #{fcmsginTxdate,jdbcType=CHAR}
  and FCMSGIN_BRNO = #{fcmsginBrno,jdbcType=CHAR}
  and FCMSGIN_FEPNO = #{fcmsginFepno,jdbcType=CHAR}
